(1, 1, 1669754661, 1669730836, 1, 0, 0, 0, 0, 0, 'This is an Empty Site Package TypoScript template.\r\n\r\nFor each website you need a TypoScript template on the main page of your website (on the top level). For better maintenance all TypoScript should be extracted into external files via @import \'EXT:site_myproject/Configuration/TypoScript/setup.typoscript\'', 0, 0, 0, 0, 0, 'Main TypoScript Rendering', 1, 1, 'EXT:fluid_styled_content/Configuration/TypoScript/,EXT:fluid_styled_content/Configuration/TypoScript/Styling/,EXT:bootstrap_package/Configuration/TypoScript/Bootstrap5', '', 'page = PAGE\r\npage.10 = TEXT\r\npage.10.value (\r\n   <div>\r\n   </div>\r\n)\r\npage.100 = CONTENT\r\npage.100 {\r\n    table = tt_content\r\n    select {\r\n        orderBy = sorting\r\n        where = {#colPos}=0\r\n    }\r\n}\r\n', NULL, 0, 0, 0);

